import { AppBar, Toolbar, Typography, Button, Box } from "@mui/material";
import { Link as RouterLink } from "react-router-dom";

export default function Navbar() {
  return (
    <AppBar position="static" color="primary">
      <Toolbar sx={{ justifyContent: "space-between" }}>
        <Typography variant="h6">Odyssey of Wisdom</Typography>
        <Box>
          <Button color="inherit" component={RouterLink} to="/">About</Button>
          <Button color="inherit" component={RouterLink} to="/projects">Projects</Button>
          <Button color="inherit" component={RouterLink} to="/feedback">Feedback</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}
